import React from "react";

import "./App.css";
import { BrowserRouter as Router, Route } from 'react-router-dom';
import {Switch} from "react-router-dom"

import Home from "./Component/Home";





function App() {
  return <div className="App">
    <Router>
      <Switch>
        <Route path="/">
          <Home />
        </Route>
      </Switch>
    </Router>
    </div>;
}

export default App;
